import styled from 'styled-components';

export const LinkingWrapper = styled.div`
  
ul {
    list-style-type:none;
    display: flex;
  padding-left: 40%;
}
li {
    display: flex;
    position: relative;
    font-size: 12px;
    margin-left: 10px;
    margin-right: 10px;
    a {
        text-decoration: none;
        color: black;
    }
}
`
